// src/App.js

import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Login from "./pages/Login";
import Register from "./pages/Register";
import SchoolRegistrationWizard from "./pages/SchoolRegistrationWizard";
import SchoolDashboard from "./pages/SchoolDashboard";
import PlayerProfile from "./pages/PlayerProfile";
import PlayerRegister from "./pages/PlayerRegister"; // Make sure you have this component!
import AdminDashboard from "./pages/AdminDashboard";// Import more pages as you build them

import "./i18n";

export default function App() {
  return (
    <Router>
      <div className="min-h-screen bg-blue-50">
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<SchoolRegistrationWizard />} />
          <Route path="/dashboard" element={<SchoolDashboard />} />
          <Route path="/player/:id" element={<PlayerProfile />} />
          <Route path="/register-player" element={<PlayerRegister />} />
          <Route path="/admin/dashboard" element={<AdminDashboard />} />

          {/* Add more routes as needed */}
        </Routes>
      </div>
    </Router>
  );
}
